import React from 'react';

function SoundStageList({ soundStages }) {
  if (!soundStages || soundStages.length === 0) {
    return <div>No sound stages available.</div>;
  }

  return (
    <div>
      {soundStages.map((studio) => (
        <div key={studio.id}>
          <h2>{studio.studio_name}</h2>
          <div>City: {studio.city}</div>
          <div>State: {studio.state}</div>
          <div>Country: {studio.country}</div>
          <ul>
            {studio.sound_stages.map((stage) => (
              <li key={stage.stage_id}>
                <h3>Stage Number: {stage.stage_number}</h3>
                <ul>
                  {stage.available_dates.map((date) => (
                    <li key={date.id}>
                      <div>Start Date: {date.start_date}</div>
                      <div>End Date: {date.end_date || 'N/A'}</div>
                    </li>
                  ))}
                </ul>
              </li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
}

export { SoundStageList };
